import { useEffect, useState, useRef } from "react";
import * as tt from "@tomtom-international/web-sdk-maps";

function App() {
  const mapElement = useRef()
  const [map, setMap] = useState({})

  useEffect(() => {
    let map = tt.map({
      key: process.env.REACT_APP_TOMTOM_API_KEY,
      container: "map",
    })
    setMap(map)
  } , [])

  return (
    <div className="App">
      <div id="map"></div>
        <div className="map-controls">
          <button onClick={() => map.setCenter({ lat: 52.370216, lng: 4.895168 })}>
            Center map on Amsterdam
          </button>

          <button onClick={() => map.setZoom(10)}>
            Zoom in
          </button>

          <button onClick={() => map.setZoom(1)}>
            Zoom out
          </button>

          <button onClick={() => map.setZoom(map.getZoom() + 1)}>
            Zoom in by 1
          </button>
        </div>


    </div>
  );
}

export default App;
